  false,\n\t\"url\": null,\n\t\"notes\": \"This annual water use report summarizes
  water sources and water use at Fish Springs National Wildlife Refuge (NWR) for 1993.
  The report begins with general information relating to water rights, water management,
  and maintenance throughout the year.  Data is provided for 1993 water supply and
  conductivity of spring flows for each month, as well as monthly water use for impounded
  management units.    Lastly, a water management plan for 1994 water use is provided
  for each feature at Fish Springs NWR.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
